import React from "react";
// import InstagramEmbed from 'react-instagram-embed';
import './App.css';



function Home() {


    return (
      <div className = "home" >
        <h1>Welcome Home</h1>
        <div>
            <h1>Chicago Fight Team</h1>
            <center>
                <iframe
                    src="https://www.instagram.com/chicagofightteam/embed"
                    width="320"
                    height="400"
                    frameborder="0"
                    scrolling="no"
                    allowtransparency="true"


                ></iframe>
                </center>
            </div>
       </div>
    );
  }

export default Home;
